import React from 'react';
class App extends React.Component{
  constructor(){
    super();
    this.state={
      name:"miku",
      rollno:"12233",
      age:20
    }
  }
  update=()=>{
    this.setState({
      name:"manish",
      rollno:"19eskcs132",
      age:21
    })
  }
  render(){
    return(
      <>
      <h1>Reactjs state</h1>
      <h2>name:{this.state.name}</h2>
      <h2>Rollno:{this.state.rollno}</h2>
      <h2>age:{this.state.age}</h2>
      <button onClick={this.update}>update</button>
      </>
      )
  }
}

export default App;
